import { Router } from 'react-router-dom';
import './App.css';
import Navbar from './component/navbar';
import {Route, Switch } from 'react-router-dom';
import HomePage from './page/home';
function App() {
  return (
    <div className="App">
      <Router>
          <Navbar/>
          <Switch>
            <Route exact path="/" component={HomePage}></Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
